// This is the main reusable component
const IconSVG = ({name, width, height, fillColor}) => {
  const icon = svgList[name];

  if (!icon) {
    console.warn(`No SVG found for "${name}"`);
    return null;
  }
  const updatedIcon = icon.replace(/\${fillColor}/g, fillColor);
  return <SvgXml xml={updatedIcon} width={width} height={height} />;
};

export default IconSVG;
